Documentario suulle misteriose formazioni geometriche regolari e varianti da forma semplice a complessa, che si manifestano in campi di grano, loglio o erba medica, prevalentemente in Inghilterra (con alcune significative eccezioni), mediante un fenomeno di piegatura e intreccio degli steli.
